import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Header from './components/Header/header'

function App() {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Routes>
          <Route index element="/"></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
